import React from 'react';

const App = () => {

  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Layout/>}>
            <Route index element={<HomePage/>}/>
            <Route path="products" element={<ProductsPage/>}/>
          </Route>
        </Routes>
      </BrowserRouter>

  );
};


export default App
